import Header from "./Header";
import NavBar from "./NavBar";
import Head from "next/head";
import "./Layout.scss";
import "../components/index.scss";



const Layout = props => (
  <div className="Layout">
     <Head>
      <title>WHATABYTE</title>
    </Head>
    <Header />
    <div className="Content">
      {props.children}
    </div>
    <NavBar />
   
  </div>
);

export default Layout;
